import React, { Component } from 'react';
import './App.css';
import FireTypeList from './components/FireTypeList'

const ogPokemon = {
  fire: [
    { id: 1, name: 'Charmander', size: 'small' },
    { id: 2, name: 'Charmeleon', size: 'medium' },
    { id: 3, name: 'Charizard', size: 'large' },
    { id: 4, name: 'Moltress', size: 'legendary' }
  ],

  grass: [
    { id: 1, name: 'Squirtle', size: 'small' },
    { id: 2, name: 'Wartortle', size: 'medium' },
    { id: 3, name: 'Blastoise', size: 'large' }
  ],

  water: [
    { id: 1, name: 'Bulbasaur', size: 'small' },
    { id: 2, name: 'Ivysaur', size: 'medium' },
    { id: 3, name: 'Venusaur', size: 'large' }
  ]
}


class App extends Component {
  render() {
    return (
      <div className="app">
        <h1>Original Pokemon</h1>
        <FireTypeList pokeData={ ogPokemon.fire } />
        <WaterTypeList pokeData={ ogPokemon.water } />
        <h3>Grass Type</h3>
        <ul className="grass">
          <li>{ ogPokemon.grass[0].name }</li>
          <li>{ ogPokemon.grass[1].name }</li>
          <li>{ ogPokemon.grass[2].name }</li>
        </ul>
        <hr/>
      </div>
    );
  }
}

export default App;
